    false,nt"url": null,nt"notes": "Mineral-resources personnel from the Alaska
    Division of Geological & Geophysical Surveys carried out a geological field survey,
    including mapping and sampling near Livengood in the Livengood B-3 and B-4 quadrangles,
    Alaska from June 10 to June 30, 2010. The fieldwork provides basic information critical
    to building an understanding of Alaskau00e2u0080u0099s geology and is part of an
    integrated program of airborne geophysical surveys followed by geological mapping.
    During 2010, 130 rock samples were collected for geochemical trace-element analysis,
    and 20 rock samples were collected for whole rock (major- and minor-oxide) analysis.
    Petrogenetically important trace elements for additional rock samples will be analyzed
    and published with the final map and report for this area.",nt"license_title":
